    return <button className={classes.square}>{value}</button>;
  };

  return (
    <div className={classes.tictactoeContainer}>
      <div>
        <Square />
        <Square />
        <Square />
        <Square />
      </div>
      <div>
        <Square />
        <Square />
        <Square />
      </div>
      <div>
        <Square />
        <Square />
        <Square />
      </div>
    </div>
  );
};

